import React from 'react';
import Link from 'react-router-dom'

function NavBar(props){
    return(
    <nav id="menu">
        <Link to="/">
            Users
        </Link>
        <Link to="/taks">
            Taks
        </Link>
    </nav>
    )
}
export default NavBar;
